By Registering you automatically get 20 - 30 % OFF on these products:</strong></p>\r\n\r\n<p>a. Brooks Running shoes<br />\r\nb. Suunto Watches<br />\r\nc. FastnUp products!<br />\r\n Just Make sure to&hellip;.</p>\r\n\r\n<p>* Team up or go Solo<br />\r\n* Track your progress every day<br />\r\n* Use a GPS App to get accurate results (Authorize Globeracers to connect to your Strava, Today&rsquo;s Plan, or Suunto App for automatic sync)<br />\r\n* Be on top of the leaderboard and Win Big!</p>\r\n', 'Event-05-11-2020-01-49-32-Image.jpg', '<p>Initial editor content.</p>\r\n', '<ol>\r\n	<li>Which activities are considered?\r\n	<ol>\r\n		<li>You can choose any activity that allows you to record miles on your GPS watch/app. Running, walking, jogging, cycling, trekking, hiking, swimming, skiing, skating, football, basketball, baseball, soccer, volleyball, badminton, tennis, table-tennis, cricket, kabaddi, kho-kho, and any regional games and activities that move you from point to point and can be tracked.</li>\r\n	</ol>\r\n	</li>\r\n	<li>Do I have to be active all 30 days of the event to earn my badge?\r\n	<ol>\r\n		<li>No, you move as per your plan, training, lifestyle. But whenever you move, ensure the miles count.</li>\r\n		<li>Your finisher badge will be digitally embossed with the total miles you contributed.</li>\r\n	</ol>\r\n	</li>\r\n	<li>Can someone do the activity for me?\r\n	<ol>\r\n		<li>Follow an honor code and the answer is, no.&nbsp;</li>\r\n	</ol>\r\n	</li>\r\n	<li>What happens if I am unable to transfer data to Strava or Today&#39;s Plan?\r\n	<ol>\r\n		<li>Please reach out to Strava, Today&rsquo;s Plan, or Suunto&rsquo;s troubleshooting team to get the issue resolved.</li>\r\n		<li>You should email us with your data at data@globeracers.com. Include your registration number, your location, your category, and complete GPS data, with a GPS data link if you sync with any of the apps such as Suunto, Garmin accounts.</li>\r\n		<li>When you can resolve the issue with Strava, Suunto, Today&rsquo;s plan ensure your data is uploaded to receive points and for standing on leaderboards.</li>\r\n	</ol>\r\n	</li>\r\n	<li>What happens if I forget to stop the watch/app?\r\n	<ol>\r\n		<li>Each activity must be no longer than 23 hrs 59 minutes and 59 seconds. Only then it will be counted as an activity per day. Our system will not be able to sync your data for the day if it exceeds this time limit.</li>\r\n	</ol>\r\n	</li>\r\n	<li>What if I do not have a GPS watch or app?\r\n	<ol>\r\n		<li>You can still participate and submit your daily mileage. Ensure you are able to measure your distance by physical means. The maximum number of kilometers that can be submitted via the manual method is 3&nbsp;km per day.</li>\r\n	</ol>\r\n	</li>\r\n</ol>\r\n', '', '', '2020-11-05 13:49:32'),
(11, 6, 0, 'Run with Pets, for Pets', 'In-Active', 5, '2021-01-14', '2021-01-18', 399, 10, NULL, 'GLOBAL', NULL, '<p>We at Globeracers value each life and we know how important it is to stay fit and happy, be it for humans or animals. COVID-19 has forced us all indoors and with the situation extended beyond a few months, it has pushed us all into a survival mode and causes emotional and physical stress. We are dedicating a day to your pets and organizing a one-day event for a fun day out running, cycling, walking, play in the park, go swimming or trail scouting to hike or trek., while we support animal shelters that care for and love animals that are not as lucky as your pet to have pet parents like you.</p>\r\n\r\n<p><em><strong>Sign up and get ready for the most fun day with your pet.</strong></em></p>\r\n\r\n<p><strong>Next steps:&nbsp;</strong></p>\r\n\r\n<ol>\r\n	<li>Register for the event.&nbsp;</li>\r\n	<li>Set the day aside (January 2, 2021)&nbsp;for yourself and your pet.</li>\r\n	<li>Plan a run/ride/long walk/trek/hike/swim for the day or simply go to the park with your pet.</li>\r\n	<li>Take a lot of pictures of yourself with your pet.</li>\r\n	<li>Post on Instagram and/or Facebook and tag Globeracers and the brands that are associated with the event.</li>\r\n	<li>Loved the day? Repeat as you wish.</li>\r\n</ol>\r\n', 'Event-03-12-2020-12-59-32-Image.png', '<ul>\r\n	<li>Take your pet out for a fun day at their favorite groomer, park to play, a stroll with their pet friends or simply lounge together and do fun things.&nbsp;</li>\r\n	<li>Treat them to new treats from their favorite brands or get them a new leash or bed.&nbsp;</li>\r\n	<li>Take them out on a car ride, if that is what they love. Some pets love and some simply can&rsquo;t stand it. Do as per your convenience and your pet&rsquo;s desire!</li>\r\n	<li>Introduce them to new pet friends if they are social!</li>\r\n	<li>Simply love them and give them your unhindered time!</li>\r\n</ul>\r\n', '<ol>\r\n	<li>Can we do this any day?\r\n	<ol>\r\n		<li>Well, we would love for you to bond with your pet every day. The event is on January 2, 2021, and you can share pictures with us of your time with your pet on that day&nbsp;</li>\r\n	</ol>\r\n	</li>\r\n	<li>Can we play with our neighbor&#39;s pet?&nbsp;\r\n	<ol>\r\n		<li>That is totally between you, your neighbor, and their pet.&nbsp;</li>\r\n	</ol>\r\n	</li>\r\n	<li>What if I cannot record this time spent with the pet using a GPS instrument or app?\r\n	<ol>\r\n		<li>That is alright. This event is not a race. Your and your pet will still receive a certificate of the fun times.&nbsp;</li>\r\n	</ol>\r\n	</li>\r\n</ol>\r\n', '', '', '2020-12-03 09:46:16'),
(14, 6, 0, 'Ultra Beast', 'Active', 1, '2021-04-10', '2021-04-11', 0, 0, NULL, 'Pokhran, Rajastha, India', NULL, '<p>The coolest race in the hottest desert - Globeracers Ultra Beast - Pokhran is a race that tests your will and endurance. Aptly title for the races tough weather conditions and terrain, we think this will be one of the best and the toughest ultra races you will ever experience. The only way to know is to sign up and find out.<br />\r\nDistances: 25 | 50 | 100 | 160KMS</p>\r\n', 'Event-06-12-2020-12-38-09-Image.png', '<p>Initial editor content.</p>\r\n', '<p>Initial editor content.</p>\r\n', '', '', '2020-12-06 12:37:31'),
(15, 6, 1, 'Being Infinite', 'In-Active', 6, '2021-01-02', '2021-01-02', 0, 0, NULL, 'Global', NULL, '<p>Set yourself free with a date with yourself for a run, ride, trek, hike, workout, or a sport with a goal to beat your competition, you. Have you procrastinated on starting&nbsp;your fitness journey? Are you giving in to your doubts and not pushing your own limits?</p>\r\n\r\n<p>If you have ever felt that you limit your progress in any way, now is the time to change that.</p>\r\n\r\n<p><strong>Have you been planning to:</strong></p>\r\n\r\n<ol>\r\n	<li>Run longer than you ever have?</li>\r\n	<li>Ride longer than you ever felt is possible?</li>\r\n	<li>Lift the heaviest you can?</li>\r\n	<li>Do more sets of Tabata workouts than you could ever push yourself to?</li>\r\n</ol>\r\n\r\n<p>Beat your limitation with a goal for yourself and show the world that you are your strength and can go solo!&nbsp;</p>\r\n\r\n<p><strong>WE ARE IN THIS TOGETHER WITH YOU.</strong></p>\r\n\r\n<p>It is in our DNA to doubt and limit ourselves. We understand that and believe that once we commit to a goal, the percentage of success grows exponentially.&nbsp;</p>\r\n\r\n<p>And, it is a FREE EVENT while you still receive the brand benefits, e-certficate, and an e-badge.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Event-06-12-2020-02-01-44-Image.png', '<p><strong>THE DATE:</strong> January 2, 2020.</p>\r\n\r\n<p><strong>WHERE</strong>: Anywhere.</p>\r\n\r\n<p><strong>WHAT: </strong>Any activity.</p>\r\n\r\n<p><strong>HOW:</strong> Record the distances using your GPS instrument or app, or if you are working out, make a video of your activity and share on social media.&nbsp;</p>\r\n\r\n<p><strong>FEE: </strong>None.&nbsp;</p>\r\n\r\n<p><strong>WHAT DO I RECEIVE?</strong>: Brand benefits and an e-certificate and e-medal that brag about your achievement.&nbsp;</p>\r\n\r\n<p><strong>CONDITIONS:</strong><em> </em>No conditions from our end other than us asking that you adhere to the honor code of doing the activity yourself and be honest about the results. Bragging rights are exponentially more satisfying when you honor the code.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '<p><strong>How to? Here are some tips:</strong></p>\r\n\r\n<ol>\r\n	<li>Register yourself for the event.</li>\r\n	<li>Set a goal/challenge for yourself.</li>\r\n	<li>Challenge a friend/s or family member/s to join you in the challenge.</li>\r\n	<li>Train solo or reach out to a coach for guidance.&nbsp;</li>\r\n	<li>Prepare well for the event day to achieve your goal</li>\r\n	<li>Set a race day plan in place.&nbsp;</li>\r\n	<li>Execute</li>\r\n	<li>Do not forget to BRAG about your success and enjoy SUCCESS.&nbsp;</li>\r\n</ol>\r\n\r\n<p>AND, until we meet you again for another challenge, do not forget to repeat the goals or set new goals!&nbsp;</p>\r\n\r\n<p><strong>What do the participants receive?</strong></p>\r\n\r\n<ul>\r\n	<li>The joy of the day spent with squashing one&rsquo;s limitations.&nbsp;</li>\r\n	<li>Discount coupons from brands</li>\r\n	<li>Brand vouchers.</li>\r\n	<li>Social media resharing on Globeracers&rsquo; platform of participant pictures&nbsp;</li>\r\n	<li>Certificate of participation&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>Who can participate?</strong></p>\r\n\r\n<p>Everyone who is already active and who wants to start being active.&nbsp;</p>\r\n\r\n<p><strong>RULES:</strong></p>\r\n\r\n<ol>\r\n	<li>Once the fun starts, don&rsquo;t let your fitness go! Enjoy the results and bragging rights.&nbsp;</li>\r\n</ol>\r\n\r\n<p><strong>GUIDELINES AND TIPS:</strong></p>\r\n\r\n<ul>\r\n	<li>Figure out what you have been procrastinating - such as speed drills, long-distance training runs/rides, a trek that is difficult, a workout that gets your goat, or a weight workout that you worry you will not last through for a single round.&nbsp;</li>\r\n	<li>Reach out to your friends/coach to make a plan.</li>\r\n	<li>Register for the event and commit to the plan.&nbsp;</li>\r\n	<li>Train your mind and body to achieve the goal as per your plan.</li>\r\n	<li>When you think of your race day, think positive, that you will achieve what you set out to do.&nbsp;</li>\r\n	<li>Set a time of the day on the race day for your activity that will not make you want to give up before you start, early hours, midday or evening, etc.&nbsp;</li>\r\n	<li>Go live with Globeracers on your race day to motivate yourself!&nbsp;</li>\r\n	<li>ENJOY THE RESULTS!!!</li>\r\n</ul>\r\n\r\n<p><strong>RESOURCES:</strong></p>\r\n\r\n<p>Reach out to Globeracers&rsquo; coaches (<a href=\"http://www.globeracers.com/experts\">www.globeracers.com/experts</a>) and join their coaching services or seek advice to make a plan.&nbsp;</p>\r\n\r\n<p><strong>LOG YOUR ACTIVITY:</strong></p>\r\n\r\n<ol>\r\n	<li>Though we will recommend unhindered time for your activity if you have a GPS watch or an app that you use to track our activities, record this activity as well so that we can add it to your certificate</li>\r\n</ol>\r\n', '', '', '2020-12-06 14:01:44'),
(16, 6, 0, 'BHATTI LAKES ULTRA', 'Active', 1, '2021-03-18', '2021-03-21', 0, 0, NULL, 'ASOLA BHATTI MINES, FARIDABAD, INDIA', NULL, '<p>Bhatti Lakes Ultra is the essential ultra that brings runners from across the country and the globe together for a city ultra trail race that refuses to be anything but tough.</p>\r\n\r\n<p>Run the trail once and be hooked, for as long you are running. Set in the middle of a busy bustling capital city and its bordering states, BLU as it is called, is a true BLUE Globeracers&#39; ultra trail race.</p>\r\n\r\n<p>2021 will be its 12th edition, having skipped the 11th edition due to the pandemic.</p>\r\n\r\n<p>CATEGORIES: 10 | 20 | 30 | 50 | 80 | 100 | 160 | 220 | 338KMS | 24 HRS</p>\r\n', 'Event-06-12-2020-02-53-28-Image.png', '<p>Initial editor content.</p>\r\n', '<p>Initial editor content.</p>\r\n', '', '', '2020-12-06 14:47:10'),
(17, 6, 0, '30 DAYS TO FITNESS', 'Active', 6, '2021-01-01', '2021-01-30', 0, 0, NULL, 'GLOBAL', NULL, '<p>Set yourself free with a date with yourself for a run, ride, trek, hike, workout, or a sport with a goal to beat your competition, you. Have you procrastinated&nbsp;start of your fitness journey? Are you giving in to your doubts and not pushing your own limits?</p>\r\n\r\n<p>For the entire month of January, either begin your journey towards health and fitness or improve on what you have already been doing. Utilize Globeracers&rsquo; user dashboard to log and keep a track of everyday progress and, if you want to keep yourself motivated, check out&nbsp;what the community is doing, right from your user dashboard.&nbsp;</p>\r\n\r\n<p>Come February, you will be ready to take on challenges and earn discounts, vouchers, coaching, nutrition consults, and brand products to improve the results of your fitness journey.&nbsp;</p>\r\n\r\n<p>If you have ever felt that you limit your progress in any way, now is the time to change that.</p>\r\n\r\n<p><strong>Have you been planning to:</strong></p>\r\n\r\n<ol>\r\n	<li>Run longer than you ever have?</li>\r\n	<li>Ride longer than you ever felt is possible?</li>\r\n	<li>Lift the heaviest you can?</li>\r\n	<li>Do more sets of Tabata workouts than you could ever push yourself to?</li>\r\n</ol>\r\n\r\n<p>Beat your limitation with a goal for yourself and show the world that you are your strength and competition, and can go solo!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>THE DATE:</strong> January 1-30, 2021.</li>\r\n	<li><strong>WHERE</strong>: Anywhere.</li>\r\n	<li><strong>WHAT: </strong>Any activity.</li>\r\n	<li><strong>HOW:</strong> Record the distances using your GPS instrument or app, or if you are working out, make a video of your activity and share it on social media.&nbsp;</li>\r\n	<li><strong>FEE: </strong>None for January.&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>WHAT DO I RECEIVE?</strong>: Brand benefits and an e-certificate and e-medal that brag about your achievement, every month.&nbsp;</p>\r\n\r\n<p><strong>CONDITIONS:</strong><em> </em>No conditions from our end other than us asking that you adhere to the honor code of doing the activity yourself and be honest about the results. Bragging rights are exponentially more satisfying when you honor the code.&nbsp;</p>\r\n\r\n<p><strong>WE ARE IN THIS TOGETHER WITH YOU.</strong></p>\r\n\r\n<p>It is in our DNA to doubt and limit ourselves. We understand that and believe that once we commit to a goal, the percentage of success grows exponentially.&nbsp;</p>\r\n\r\n<p>How to? Here are our tips:</p>\r\n\r\n<ol>\r\n	<li>Register yourself for the event.</li>\r\n	<li>Set a goal/challenge for yourself.</li>\r\n	<li>Challenge a friend/s or family member/s to join you in the challenge. You can add them to your group in the Globeracers user dashboard.&nbsp;</li>\r\n	<li>Train solo or reach out to a coach for guidance.&nbsp;</li>\r\n	<li>At the end of the month, based on what our coach/plan is set up to achieve, do a challenge.&nbsp;</li>\r\n	<li>Do not forget to BRAG about your success and enjoy SUCCESS.&nbsp;</li>\r\n</ol>\r\n\r\n<p>AND, until we meet you again for another challenge, do not forget to repeat the goals or set new goals!&nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>FOR THE PARTICIPANTS:</strong></p>\r\n\r\n<ul>\r\n	<li>The joy of the day spent with squashing one&rsquo;s limitations.&nbsp;</li>\r\n	<li>Discount coupons from brands</li>\r\n	<li>Brand vouchers.</li>\r\n	<li>Social media resharing on Globeracers&rsquo; platform of participant pictures&nbsp;</li>\r\n	<li>Certificate of participation&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>WHO CAN PARTICIPATE:</strong></p>\r\n\r\n<p>Everyone who is already active and who wants to start being active.&nbsp;</p>\r\n\r\n<p><strong>RULES:</strong></p>\r\n\r\n<ol>\r\n	<li>Once the fun starts, don&rsquo;t let your fitness go! Enjoy the results and bragging rights.&nbsp;</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Event-03-12-2020-12-59-32-Image.png', '<p><strong>GUIDELINES AND TIPS:</strong></p>\r\n\r\n<ul>\r\n	<li>Figure out what you have been procrastinating - such as starting workouts, speed drills, long-distance training runs/rides, a trek that is difficult, a workout that gets your goat, or a weight workout that you worry you will not last through for a single round.&nbsp;</li>\r\n	<li>Reach out to your friends/coach to make a plan.</li>\r\n	<li>Register for the event and commit to the plan.&nbsp;</li>\r\n	<li>Train your mind and body to achieve the goal as per your plan.</li>\r\n	<li>When you think of your workout, think positive, that you will achieve what you set out to do.&nbsp;</li>\r\n	<li>Set a time of the day each day&nbsp;for your activity that will not make you want to give up before you start, early hours, midday or evening, etc.&nbsp;</li>\r\n	<li>Keep sharing your activities on the Globeracers&#39; Community FB group to keep yourself motivated and inspire others.&nbsp;</li>\r\n	<li>ENJOY THE RESULTS!!!</li>\r\n</ul>\r\n\r\n<p><strong>RESOURCES:</strong></p>\r\n\r\n<p>Reach out to Globeracers&rsquo; coaches (<a href=\"http://www.globeracers.com/experts\">www.globeracers.com/experts</a>) and join their coaching services or seek advice to make a plan.&nbsp;</p>\r\n', '<p>Initial editor content.</p>\r\n', '', '', '2020-12-21 11:53:56');

